INSERT INTO `tbl_pages` (`id`, `pagetitle`, `pagecontent`) VALUES
(100, 'Home', '&lt;p&gt;Welcome to Govt. Champhai College. This college is the only College having 4 streams i.e Arts, Science, Commerce and BCA in Mizoram under Govt. of Mizoram. It is registered under 2(f) &amp;amp; 12-B of UGC Act under the nomenclature in 1971. It was accredited with Grade B in 2009 and Grade B++&amp;nbsp; in 2016 by NAAC.&lt;/p&gt;&lt;p&gt;&lt;b style=&quot;font-size: 1rem;&quot;&gt;NOTIFICATIONS&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Admission Notice for June 2022 &lt;br&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://admission.champhaicollege.edu.in/?page=prospectus&quot;&gt;Prospectus 2022&lt;/a&gt;&lt;/li&gt;&lt;li&gt;&lt;a href=&quot;https://admission.champhaicollege.edu.in/?page=feestructure&quot;&gt;Fee Structure for BCA, BSc, B. Com and BA&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;b style=&quot;&quot;&gt;&lt;font color=&quot;#ff0000&quot;&gt; &lt;marquee behavior=&quot;alternate&quot; width=&quot;550px&quot;&gt; Core (5th Semester) students bik tan offline a admission tih tur a ni e &lt;span class=&quot;right badge badge-danger&quot;&gt;New&lt;/span&gt; &lt;/marquee&gt;&lt;/font&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;b&gt;Notice&lt;/b&gt;: Admission chungchanga harsatna nei-te chuan heng a hnuaia tarlan, College Professor te hi biak theih reng an ni e.&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Contact Person:&lt;/b&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;&lt;b&gt;Dr. C. Lalrinmawii (&lt;a href=&quot;https://wa.me/918257094772&quot; rel=&quot;noreferrer&quot; target=&quot;_blank&quot; data-saferedirecturl=&quot;https://www.google.com/url?q=https://wa.me/918257094772&amp;amp;source=gmail&amp;amp;ust=1625228992532000&amp;amp;usg=AFQjCNGyHFP0hXNNzcXmO3DchFZFALtzhw&quot;&gt;+91 82570 94772&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Ms. Hmingsangzuali (&lt;a href=&quot;https://wa.me/918729826411&quot; target=&quot;_blank&quot;&gt;+91 87298 26411&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mr. Ramnundanga (&lt;a href=&quot;https://wa.me/917628971272&quot; target=&quot;_blank&quot;&gt;+91 76289 71272&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mr. P.C. Lalmalsawma (&lt;a href=&quot;https://wa.me/919862378278&quot; target=&quot;_blank&quot;&gt;+91 98623 78278&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Ms. Lalrinkimi (&lt;a href=&quot;https://wa.me/918014792684&quot; target=&quot;_blank&quot;&gt;+91 80147 92684&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mr. C.Zirnghakngura (&lt;a href=&quot;https://wa.me/917085180012&quot; target=&quot;_blank&quot;&gt;+91 70851 80012&lt;/a&gt;)&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mr. B. Lalawmpuia (&lt;a href=&quot;https://wa.me/919862215033&quot; target=&quot;_blank&quot;&gt;+91 98622 15033&lt;/a&gt;)&lt;/b&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;b&gt;&lt;b style=&quot;font-size: 1rem;&quot;&gt;Payment Term&lt;/b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Kindly screenshot or note down the transaction details, If you have any problems with your application further, we will be using this for verification.&lt;/span&gt;&lt;br&gt;&lt;/b&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;Kindly use Gpay / PayTM / or any other UPI for the payment.&lt;/b&gt;&lt;/li&gt;&lt;/ul&gt;&lt;b&gt;\r\n\r\n&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#FF0000&quot;&gt;&lt;b&gt;Note:&lt;/b&gt;&lt;/font&gt; Image file upload tur hi 100KB (size) aiin an te tur a ni a. Compress nan &lt;u&gt;&lt;b&gt;&lt;a href=&quot;https://compressjpeg.com&quot; target=&quot;_blank&quot;&gt;compressjpeg.com&lt;/a&gt;&lt;/b&gt;&lt;/u&gt; te pawh hi a hman theih a ni.&lt;/p&gt;&lt;/b&gt;&lt;p style=&quot;text-align: center; &quot;&gt;&lt;b&gt;&lt;a class=&quot;btn-success&quot; href=&quot;https://admission.champhaicollege.edu.in/?page=apply&quot;&gt;APPLY NOW&lt;/a&gt;&lt;/b&gt;&lt;/p&gt;\r\n'),
(101, 'Notifications', '&lt;p&gt;&lt;b&gt;Notifications&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;COURSES OFFERED&lt;/b&gt;: The following courses and degrees are offered by the institution at present.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Bachelor of Art (B.A.) in English, Mizo, Political Science, Education, History, Economics and Geography.&lt;/li&gt;&lt;li&gt;Bachelor of Science (B.Sc.) in Mathematics, Physics, Chemistry, Botany and Zoology.&lt;/li&gt;&lt;li&gt;Bachelor of Computer Applications (B.C.A.) and Diploma in Computer Applications (D.C.A.).&lt;/li&gt;&lt;li&gt;Bachelor of Commerce (B. Com)&lt;/li&gt;&lt;li&gt;Certificate Course in Computer Concept (C.C.C.)&lt;/li&gt;&lt;li&gt;Add-on courses in Spoken English, Spoken Hindi and Spoken Burmese.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;ADMISSION 2022 Open&lt;/b&gt;&lt;/p&gt;'),
(102, 'Important Dates', '&lt;p&gt;&lt;b&gt;All important dates for the upcoming June 2022 Admission are given below:\r\n\r\n&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;ul&gt;\r\n&lt;li&gt;Availability of Prospectus &amp; Admission Form: 1st June 2022&lt;/li&gt;\r\n&lt;li&gt;Start date for Online Applications: 1st June 2022 (04:00AM)&lt;/li&gt;\r\n&lt;li&gt;Last date for Online Applications:  24th June, 2022 (11:59PM), Candidate may be allowed to take admission with late fee, hereon.&lt;br&gt;&lt;/li&gt;\r\n&lt;li&gt;Date of Direct Admission: Within 5 working day after Principal / Staff approval &lt;/li&gt;\r\n\r\n&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;'),
(103, 'Eligibility', '&lt;p&gt;For further details, kindly refer the prospectus.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;&lt;b&gt;Eligibility for different streams are given below:&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;For Admission to &lt;b&gt;Bachelor of Sciences (BSc)&lt;/b&gt;&lt;ul&gt;&lt;li&gt;passed in 10+2 (Science Stream) only will be considered.&lt;/li&gt;&lt;li&gt;students who score &lt;b&gt;55% (Theory) &lt;/b&gt;in HSSLC of their respective subjects will be consider for &lt;b&gt;DIRECT ADMISSION&lt;/b&gt; depending on availability of seats.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;&lt;ul&gt;&lt;li&gt;For &lt;b&gt;BA&lt;/b&gt; admission&lt;ul&gt;&lt;li&gt;passed in any stream from 10+2 will be considered.&lt;/li&gt;&lt;li&gt;students who score &lt;b&gt;55% (Theory)&lt;/b&gt; in HSSLC of their respective subjects will be consider for &lt;span style=&quot;font-weight: bolder;&quot;&gt;DIRECT ADMISSION&lt;/span&gt; depending on availability of seats.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;&lt;ul&gt;&lt;/ul&gt;&lt;p&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;For &lt;b&gt;BCom&lt;/b&gt; admission&lt;/li&gt;&lt;ul&gt;&lt;li&gt;passed in any stream from 10+2 will be considered.&lt;/li&gt;&lt;li&gt;students who score above &lt;b&gt;55% (Theory)&lt;/b&gt; in HSSLC of their respective subjects will be consider for &lt;span style=&quot;font-weight: bolder;&quot;&gt;DIRECT ADMISSION&lt;/span&gt; depending on availability of seats.&lt;/li&gt;&lt;/ul&gt;&lt;/ul&gt;&lt;ul&gt;&lt;li&gt;For admission to &lt;b&gt;Bachelor of Computer Applications (BCA)&lt;/b&gt;,&lt;ul&gt;&lt;li&gt;passed any stream of 10+2 can apply but students having mathematics background in 10+2 are preferred.&lt;/li&gt;&lt;li&gt;students who score above &lt;b&gt;45% (Theory)&lt;/b&gt; in HSSLC of their respective subjects will be consider for &lt;span style=&quot;font-weight: bolder;&quot;&gt;DIRECT ADMISSION&lt;/span&gt; depending on availability of seats.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;'),
(104, 'Prospectus', '&lt;p&gt;Printed copy of the latest prospectus including application can be obtained from office within office hours. The same prospectus in digital format (.pdf) is available for download below:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;b&gt;&lt;a href=&quot;https://drive.google.com/file/d/1NMCrQfcSiHq7lmYeYT7wfXfJB4FVRH17/view?usp=sharing&quot; class=&quot;btn btn-primary&quot; target=&quot;_blank&quot;&gt;Click here to download Prospectus 2022&lt;/a&gt;&lt;/b&gt; &lt;span class=&quot;right badge badge-danger&quot;&gt;New&lt;/span&gt;&lt;br&gt;&lt;/p&gt;'),
(105, 'Apply Now', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;APPLY NOW&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Online Application is treated on par with paper-based application form obtained from Principal Office during office hours. But in order to apply, you must have the followings in image (.jpg) format to be uploaded: (Note: To make our online application process easier, we do not have any restrictions in size of photos).&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Recent Colour Passport Photo&lt;/li&gt;&lt;li&gt;Signature in white background&lt;/li&gt;&lt;li&gt;Scan copy of HSLC Marksheet (or equivalent)&lt;/li&gt;&lt;li&gt;Scan copy of HSSLC Marksheet&amp;nbsp;(or equivalent)&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;font color=&quot;#FF0000&quot;&gt;&lt;b&gt;Note&lt;/b&gt;&lt;/font&gt;: Image file upload tur hi 100KB (size) aiin an te tur a ni a. Compress nan &lt;a href=&quot;https://compressjpeg.com/&quot; target=&quot;_blank&quot;&gt;compressjpeg.com&lt;/a&gt; te pawh hi a hman theih a ni. Image I upload dawn in I computer / Phone memory a awm ngei upload tur a ni a, gdrive emaw, adangte atang a upload theih a ni lo.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;IMPORTANT INFORMATION&lt;/b&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;You will receive Application No and Password in your registered email and through SMS on your phone number. Sometimes, SMS got delay a little bit and therefore, in that case, check your email for login credentials.&amp;nbsp;&lt;/li&gt;&lt;li&gt;You must complete personal details, educational details and subject combination in order to process your application further.&amp;nbsp;&lt;/li&gt;&lt;li&gt;If you get some error message in the last stage i.e. Declaration, it is OK, if you completed SlNo 2 above, you application will be accepted. Our technical experts are fixing the issue.&lt;/li&gt;&lt;li&gt;Please do not submit more than 1 application, if submitted only 1 application will be accepted randomly and others will be rejected.&lt;/li&gt;&lt;li&gt;In case any problem, feel free to talked to our admission Working Chairman&amp;nbsp;/ Secretary, Dr. Lalnunpuia, Mobile :&amp;nbsp;&lt;a href=&quot;https://wa.me/918837240380&quot; target=&quot;_blank&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;+91 8837240380&lt;/a&gt; | Ms. Lalnunthari, Mobile: &lt;a href=&quot;tel:+91 8787532067&quot; target=&quot;_blank&quot;&gt;+91 &lt;font color=&quot;#3984c6&quot;&gt;85&lt;/font&gt;&lt;/a&gt;&lt;font color=&quot;#3984c6&quot;&gt;75710833&lt;/font&gt;&lt;br&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bolder;&quot;&gt;HRIATTUR PAWIMAWH&lt;/span&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Dilna i submit zawh hunah i email leh phone number ah Application No leh password a lo thleng ang. A chang chuan SMS hi a thleng tlai thin a, chuvangin, i email en ang che.&amp;nbsp;&lt;/li&gt;&lt;li&gt;I dilna pawm a nih theih nan Personal Details, Educational Details leh Subject combination te tihfel vek a ngai.&lt;/li&gt;&lt;li&gt;A tawp Declaration a Error Message i dawng a nih chuan lungngai suh, a chunga SlNo 2 i zo a nih phawt chuan i dilna pawm a ni tho ang. Kan mithiamten siam dik an tum mek e.&lt;/li&gt;&lt;li&gt;Online dilna hi vawi 1 aia tam submit suh ang che. Vawi 1 aia tam i submit chuan, i dilna zinga pakhat kha pawm a ni ang a, a dang zawng Reject a ni ang.&lt;/li&gt;&lt;li&gt;Eng emaw harsatna i tawk a nih chuan kan admission Working Chairman / Secretary, Dr. Lalnunpuia, Mobile :&amp;nbsp;&lt;a href=&quot;https://wa.me/918837240380&quot; target=&quot;_blank&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;+91 8837240380&lt;/a&gt; | Ms. Lalnunthari, Mobile: &lt;a href=&quot;https://wa.me/918575710833&quot; target=&quot;_blank&quot;&gt;+91 85757 10833&lt;/a&gt;.&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;Contact Person:&lt;/p&gt;&lt;ol&gt;&lt;li&gt;Dr C. Lalrinmawii &lt;br&gt;&lt;/li&gt;&lt;li&gt;Ms Hmingsangzuali (&lt;a href=&quot;https://wa.me/918729826411&quot; target=&quot;_blank&quot;&gt;+91 87298 26411&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mr Ramnundanga (&lt;a href=&quot;https://wa.me/917628971272&quot; target=&quot;_blank&quot;&gt;+91 76289 71272&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mr P.C. Lalmalsawma (&lt;a href=&quot;https://wa.me/919862378278&quot; target=&quot;_blank&quot;&gt;+91 98623 78278&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;li&gt;Ms Lalrinkimi (&lt;a href=&quot;https://wa.me/918014792684&quot; target=&quot;_blank&quot;&gt;+91 80147 92684&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mr C.Zirnghakngura (&lt;a href=&quot;https://wa.me/917085180012&quot; target=&quot;_blank&quot;&gt;+91 70851 80012&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mr B. Lalawmpuia (&lt;a href=&quot;https://wa.me/919862215033&quot; target=&quot;_blank&quot;&gt;+91 98622 15033&lt;/a&gt;)&lt;br&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#FF0000&quot;&gt;&lt;b&gt;**Note: Payment I pek lai leh zawh hnuah page reng reng refresh loh tur a ni a. I refresh a nih chuan kan record ah a lut thei dawn lova, pawisa I chawi nawn a nih pawh in I sawisel thei lovang.&lt;/b&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p align=&quot;center&quot;&gt;&lt;a href=&quot;?page=applynow&quot; class=&quot;btn btn-success&quot;&gt;CLICK HERE TO APPLY NOW&lt;/a&gt;&lt;/p&gt;&lt;p align=&quot;center&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p align=&quot;center&quot;&gt;&lt;b&gt;For those who already registered&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;a href=&quot;https://admission.champhaicollege.edu.in/applicantlogin.php&quot; class=&quot;btn btn-info&quot;&gt;CLICK HERE TO LOGIN&lt;/a&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;');
