fee shall be conceded for differently abled persons\r\nhaving Identity Card&lt;/i&gt;)&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;text-align:center;\r\nmso-layout-grid-align:none;text-autospace:none&quot; align=&quot;center&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;text-align:center;\r\nmso-layout-grid-align:none;text-autospace:none&quot; align=&quot;center&quot;&gt;&lt;a class=&quot;btn btn-success&quot; href=&quot;https://drive.google.com/file/d/1H2VxAMz8O-EnucHcc2zuXytoJazR40ft/view?usp=sharing&quot; target=&quot;_blank&quot;&gt;Download Fee Structure &lt;/a&gt;&lt;br&gt;&lt;/p&gt;&lt;br&gt;');
INSERT INTO `tbl_pages` (`id`, `pagetitle`, `pagecontent`) VALUES
(107, 'Privacy Policy', '&lt;p&gt;&lt;b&gt;Website privacy&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;This privacy policy sets out \r\nhow Govt Champhai College uses and protects any \r\ninformation that you give Govt Champhai College when\r\n you use this website.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Govt Champhai College is committed to ensuring that your privacy is protected.\r\n Should we ask you to provide certain information by which you can be \r\nidentified when using this website, then you can be assured that it will\r\n only be used in accordance with this privacy statement.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Govt Champhai College may change this policy from time to\r\n time by updating this page. You should check this page from time to \r\ntime to ensure that you are happy with any changes. This policy is \r\neffective from 1st June, 2021.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;What we collect&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We may collect the following information:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;    name&lt;/p&gt;&lt;p&gt;    contact information including email address&lt;/p&gt;&lt;p&gt;    demographic information such as postcode, preferences and interests&lt;/p&gt;&lt;p&gt;    Academic qualifications and programmes you wish to apply for.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;What we do with the information we gather&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We\r\n require this information to understand your needs and provide you with a\r\n better service, and in particular for the following reasons:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;    Internal record keeping.&lt;/p&gt;&lt;p&gt;    We may use the information to improve our marketing techniques.&lt;/p&gt;&lt;p&gt; \r\n   We may periodically send promotional emails or sms’s about new \r\nprogrammes being launched or other information which we think you may \r\nfind interesting using the email address which you have provided.&lt;/p&gt;&lt;p&gt; \r\n   From time to time, we may also use your information to contact you \r\nfor market research purposes. We may contact you by email, phone, fax or\r\n mail.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Security&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We are \r\ncommitted to ensuring that your information is secure. In order to \r\nprevent unauthorised access or disclosure we have put in place suitable \r\nphysical, electronic and managerial procedures to safeguard and secure \r\nthe information we collect online.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;How we use cookies&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;A\r\n cookie is a small file which asks permission to be placed on your \r\ncomputer’s hard drive. Once you agree, the file is added and the cookie \r\nhelps analyse web traffic or lets you know when you visit a particular \r\nsite. Cookies allow web applications to respond to you as an individual.\r\n The web application can tailor its operations to your needs, likes and \r\ndislikes by gathering and remembering information about your \r\npreferences.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We use traffic log cookies to identify \r\nwhich pages are being used. This helps us analyse data about webpage \r\ntraffic and improve our website in order to tailor it to customer needs.\r\n We only use this information for statistical analysis purposes and then\r\n the data is removed from the system.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Overall, cookies \r\nhelp us provide you with a better website, by enabling us to monitor \r\nwhich pages you find useful and which you do not. A cookie in no way \r\ngives us access to your computer or any information about you, other \r\nthan the data you choose to share with us.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;You can \r\nchoose to accept or decline cookies. Most web browsers automatically \r\naccept cookies, but you can usually modify your browser setting to \r\ndecline cookies if you prefer. This may prevent you from taking full \r\nadvantage of the website.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Links to other websites&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Our\r\n website may contain links to other websites of interest. However, once \r\nyou have used these links to leave our site, you should note that we do \r\nnot have any control over that other website. Therefore, we cannot be \r\nresponsible for the protection and privacy of any information which you \r\nprovide whilst visiting such sites and such sites are not governed by \r\nthis privacy statement. You should exercise caution and look at the \r\nprivacy statement applicable to the website in question.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Controlling your personal information&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;You may choose to restrict the collection or use of your personal information in the following ways:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt; \r\n   whenever you are asked to fill in a form on the website, look for the\r\n box that you can click to indicate that you do not want the information\r\n to be used by anybody for direct marketing purposes&lt;/p&gt;&lt;p&gt;    if you \r\nhave previously agreed to us using your personal information for direct \r\nmarketing purposes, you may change your mind at any time by unclicking \r\nit.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We will not sell, distribute or lease your personal\r\n information to third parties unless we have your permission or are \r\nrequired by law to do so. We may use your personal information to send \r\nyou promotional information about third parties which we think you may \r\nfind interesting if you tell us that you wish this to happen.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;You\r\n may request details of personal information which we hold about you \r\nunder the Data Protection Act 1998. A small fee will be payable. If you \r\nwould like a copy of the information held on you please write to principal@champhaicollege.edu.in&lt;/p&gt;'),
(108, 'Refund Policy', '&lt;p&gt;&lt;b&gt;REFUND POLICY&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Candidates can pay the \r\napplication fees using three modes of payment- Credit-Debit, Net Banking\r\n and by paying cash at the SBI. Once the payment is done and necessary \r\ndocuments have been uploaded for eg. scanned copy of the candidate’s \r\nphotograph, scanned copy of the candidate’s signature, scanned copy of \r\nthe bank challan if the candidate has paid using cash, the application \r\nwill be considered complete and a short summary of the filled in details\r\n and payment details will be generated, this is an acknowledgement and \r\nthe candidate should take a printout and keep it till the admission \r\nprocess is over.&lt;/p&gt;&lt;p&gt;There is an eligibility criteria for each \r\nprogramme/courses and the eligibility criteria will be clearly mentioned\r\n in the information brochure, the candidate is requested to go through \r\nit carefully. A candidate applying for a programme/courses for which \r\nhe/she is not eligible will not be given a refund of application fees.&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#FF0000&quot;&gt;&lt;b&gt; Fees once paid is not refundable.&lt;/b&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;Candidates who end up paying the application fees using the payment \r\ngateway more than once will be given a refund of the extra amount paid \r\nwithin 30 days, however such candidates are supposed to raise a ticket \r\nby filling up a support form which will be a part of the online \r\napplication form. If required the candidate may be asked to submit a \r\nproof which shows that payment has been done more that once.&lt;/p&gt;&lt;p&gt;If a candidate is found to have given incorrect details about his/her \r\nacademic qualification, personal details, caste details he/she will be \r\ndisqualified and will not be given a refund of the application fees&lt;/p&gt;'),
(109, 'Contact Us', '&lt;p style=&quot;margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.6; color: rgb(77, 77, 77); font-family: &quot; open=&quot;&quot;&gt;Govt.Champhai College, Champhai, Mizoram possesses the unique \r\nposition of being the first and only with Four Streams - college in the State of \r\nMizoram, NE India. It was established by an act of the State Assembly in1971 with the primary vision of providing better education. Since \r\nthen, the defined goal of the college is to ensure quality education for\r\n empowering the native people - who are educationally backward in \r\nscience education - by enhancing the status of science and technology. \r\nSince then, the college is now proudly marching towards its second \r\ndecade of existence.&lt;br&gt;&lt;br&gt;The College was accredited with \r\nGrade B++ by NAAC in 2016. Re-collecting and reflecting on our quality \r\nstatus during these past years, and endeavouring to live true to the \r\nmotto, ‘For Better and Ever’ the College has now volunteered for a third accreditation cycle. In spite of the seemingly difficult situations and\r\n working conditions, we choose to persevere. All efforts within our \r\ncapacity are taken into perspective to involve the stakeholders – \r\nstudents, faculty members, alumni, parents, and the Government to ensure\r\n quality sustenance and enhancement.&lt;/p&gt;&lt;h1 style=&quot;margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Raleway, Verdana, Geneva, sans-serif; color: rgb(77, 77, 77); text-rendering: optimizelegibility; font-size: 1.7em;&quot;&gt;About this website&lt;/h1&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.6; color: rgb(77, 77, 77); font-family: &quot; open=&quot;&quot;&gt;This website is maintained by Website Committee which is now renamed at ICT Cell which is appointed each year. &lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.6; color: rgb(77, 77, 77); font-family: &quot; open=&quot;&quot;&gt;&lt;b&gt;Contact Us&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.6; color: rgb(77, 77, 77); font-family: &quot; open=&quot;&quot;&gt;Principal,&lt;br&gt;Govt. Champhai College,&lt;br&gt;Vengthlang North, Champhai&lt;br&gt;Mizoram, India 796321&lt;br&gt;&lt;br&gt;&lt;b&gt;+91 96123 22565&lt;br&gt;&lt;/b&gt;&lt;/p&gt;'),
(110, 'Term and Condition', '&lt;p&gt;Terms &amp;amp; Conditions&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;Welcome \r\nto Govt. Champhai College Admission website. If \r\nyou continue to browse and use this website you are agreeing to comply \r\nwith and be bound by the following terms and conditions of use, which \r\ntogether with our privacy policy govern Govt. Champhai College relationship with you in relation to this website.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 1rem;&quot;&gt;The\r\n term ‘Govt. Champhai College or &quot;us&quot; or &quot;we&quot; refers \r\nto the owner of the website whose registered office is at P.O Box \r\n796321, Electric Veng, Champhai, Mizoram. The term ‘you’ refers to the user\r\n or viewer of our website.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The use of this website is subject to the following terms of use:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The content of the pages of this website is for your general \r\ninformation and use only. It is subject to change without notice.&lt;/p&gt;&lt;p&gt;Neither we nor any third parties provide any warranty or guarantee as\r\n to the accuracy, timeliness, performance, completeness or suitability \r\nof the information and materials found or offered on this website for \r\nany particular purpose. You acknowledge that such information and \r\nmaterials may contain inaccuracies or errors and we expressly exclude \r\nliability for any such inaccuracies or errors to the fullest extent \r\npermitted by law.&lt;/p&gt;&lt;p&gt;&amp;nbsp;Your use of any information or materials on \r\nthis website is entirely at your own risk, for which we shall not be \r\nliable. It shall be your own responsibility to ensure that any products,\r\n services or information available through this website meet your \r\nspecific requirements.&lt;/p&gt;&lt;p&gt;This website contains material which is\r\n owned by or licensed to us. This material includes, but is not limited \r\nto, the design, layout, look, appearance and graphics. Reproduction is \r\nprohibited other than in accordance with the copyright notice, which \r\nforms part of these terms and conditions.&lt;/p&gt;&lt;p&gt;All trade marks \r\nreproduced in this website which are not the property of, or licensed \r\nto, the operator are acknowledged on the website.&lt;/p&gt;&lt;p&gt;Unauthorised use of this website may give rise to a claim for damages and/or be a criminal offence.&lt;/p&gt;&lt;p&gt;From time to time this website may also include links to other \r\nwebsites. These links are provided for your convenience to provide \r\nfurther information. They do not signify that we endorse the website(s).\r\n We have no responsibility for the content of the linked website(s).&lt;/p&gt;&lt;p&gt;You may not create a link to this website from another website or \r\ndocument without Govt. Champhai College prior written\r\n consent.&lt;/p&gt;&lt;p&gt;Your use of this website and any dispute arising out\r\n of such use of the website is subject to the laws of India or other \r\nregulatory authority.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;“We as a merchant shall be under \r\nno liability whatsoever in respect of any loss or damage arising \r\ndirectly or indirectly out of the decline of authorization for any \r\nTransaction, on Account of the Cardholder having exceeded the preset \r\nlimit mutually agreed by us with our acquiring bank from time to time”&lt;/p&gt;');

